// src/App.js
import React from 'react';
import Board from './components/Board';
import Greeting from './components/Greeting';
import './styles/style.css';

function App() {
  return (
    <div className="App">
      <header className="header">
        <h1>Collaborative Project Management Tool</h1>
      </header>
      <Greeting />
      <Board />
    </div>
  );
}

export default App;
